import React from 'react'
import PropTypes from 'prop-types'


export default function StoredComments(props) {

    let getKeys = ()=>{
        for (let i=0; i<localStorage.length; i++){
            let myKey = localStorage.key(i);
            let myObj = JSON.parse(localStorage.getItem(myKey));
            console.log(myObj.body)
        }
    }
    return (
        <>
            <button onClick={getKeys}>Keys</button>
        </>
    )
}
